import { Component, OnInit } from "@angular/core";
import { Observable } from "rxjs";
import { BreakpointObserver } from "@angular/cdk/layout";
import { StepperOrientation } from "@angular/material/stepper";
import { DomSanitizer, SafeResourceUrl } from "@angular/platform-browser";
import { map } from "rxjs/operators";
import { TranslocoService } from "@ngneat/transloco";

@Component({
	selector: "app-stepper-component",
	templateUrl: "./stepper.component.html",
	styleUrls: ["./stepper.component.scss"]
})
export class StepperComponent implements OnInit {
	stepperOrientation: Observable<StepperOrientation> | undefined;
	cvUrl: SafeResourceUrl | undefined;
	cvName: String | undefined;
	cvDataCz =
		"data:application/pdf;base64,";
	cvDataEn =
		"data:application/pdf;base64,";
	constructor(
		private breakpointObserver: BreakpointObserver,
		private sanitizer: DomSanitizer,
		private translocoService: TranslocoService
	) {
		translocoService.langChanges$.subscribe((lang) => {
			this.setCvUrl(lang);
			this.cvName = `antonina-nesmelova-cv-${lang}.pdf`;
		});
	}

	async ngOnInit(): Promise<void> {
		this.setStepperOrientation();
	}

	setStepperOrientation(): void {
		this.stepperOrientation = this.breakpointObserver
			.observe("(min-width: 1200px)")
			.pipe(map(({ matches }) => (matches ? "horizontal" : "vertical")));
	}

	async setCvUrl(lang: String): Promise<void> {
		const r = await fetch(lang == "en" ? this.cvDataEn : this.cvDataCz);
		const blob = await r.blob();
		var url = window.URL.createObjectURL(blob);

		this.cvUrl = this.sanitizer.bypassSecurityTrustResourceUrl(url);
	}
}
